import './GalleryScroll.css'
import StyledImage from './StyledImage';


function GalleryScroll(props) {

    const { children, images, ...other } = props;

    return (
        <div style={{display: 'flex', alignItems: 'center'}}>
            <div id='slider' style={{ width: "100%", height: '100p%', overflow: "auto", display: "flex", alignItems: 'center' }}>
                {images.map((img) => {
                    return (
                        <StyledImage src={img} height={'10px'} width={'auto'}></StyledImage>
                    );
                })}
            </div>
        </div>
    );
}

export default GalleryScroll;
